import React, { useState, useEffect } from 'react';
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import Icon from "@mui/material/Icon";
import Box from "@mui/material/Box";
import LinearProgress from "@mui/material/LinearProgress";

// Argon Dashboard 2 MUI components
import MDBox from "components/ArgonBox";
import MDTypography from "components/ArgonTypography";
import MDButton from "components/ArgonButton";
import MDAlert from "components/ArgonAlert";

// Argon Dashboard 2 MUI example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";

// Mock data - replace with actual backend data
const mockInstitutionData = [
  { 
    id: 1, 
    name: "Central Primary School", 
    type: "Education", 
    complianceScore: 75, 
    isCompliant: true,
    lastInspectionDate: "2023-06-15",
    violations: ["Minor infrastructure issues"],
    riskLevel: "Low",
    requiredActions: ["Repair classroom windows", "Update safety manual"]
  },
  { 
    id: 2, 
    name: "Community Health Center", 
    type: "Healthcare", 
    complianceScore: 45, 
    isCompliant: false,
    lastInspectionDate: "2023-05-20",
    violations: [
      "Inadequate medical supplies", 
      "Outdated medical equipment", 
      "Insufficient staff training"
    ],
    riskLevel: "High",
    requiredActions: [
      "Procure essential medical supplies", 
      "Upgrade medical equipment", 
      "Conduct staff training program"
    ]
  },
  { 
    id: 3, 
    name: "Local Government Office", 
    type: "Government", 
    complianceScore: 90, 
    isCompliant: true,
    lastInspectionDate: "2023-07-01",
    violations: [],
    riskLevel: "Very Low",
    requiredActions: []
  },
];

function ComplianceAnalytics() {
  const [institutions, setInstitutions] = useState(mockInstitutionData);
  const [nonCompliantInstitutions, setNonCompliantInstitutions] = useState([]);
  const [complianceMetrics, setComplianceMetrics] = useState({
    totalInstitutions: 0,
    compliantInstitutions: 0,
    nonCompliantInstitutions: 0,
    overallComplianceRate: 0,
    highRiskInstitutions: 0
  });

  useEffect(() => {
    // Compute compliance metrics
    const totalInstitutions = institutions.length;
    const compliantInstitutions = institutions.filter(inst => inst.isCompliant).length;
    const nonCompliant = institutions.filter(inst => !inst.isCompliant);
    const overallComplianceRate = (compliantInstitutions / totalInstitutions) * 100;
    const highRiskInstitutions = institutions.filter(inst => inst.riskLevel === "High").length;

    setNonCompliantInstitutions(nonCompliant);
    setComplianceMetrics({
      totalInstitutions,
      compliantInstitutions,
      nonCompliantInstitutions: nonCompliant.length,
      overallComplianceRate,
      highRiskInstitutions
    });
  }, [institutions]);

  const renderComplianceCard = (institution) => (
    <Grid item xs={12} key={institution.id}>
      <Card>
        <MDBox p={2}>
          <Grid container spacing={2} alignItems="center">
            <Grid item xs={4}>
              <MDTypography variant="h6">{institution.name}</MDTypography>
              <MDTypography variant="caption" color={institution.isCompliant ? "success" : "error"}>
                {institution.type} | {institution.riskLevel} Risk
              </MDTypography>
            </Grid>
            <Grid item xs={4}>
              <MDBox>
                <MDTypography variant="caption">Compliance Score</MDTypography>
                <Box sx={{ display: 'flex', alignItems: 'center' }}>
                  <Box sx={{ width: '100%', mr: 1 }}>
                    <LinearProgress 
                      variant="determinate" 
                      value={institution.complianceScore} 
                      color={institution.isCompliant ? "success" : "error"}
                    />
                  </Box>
                  <Box sx={{ minWidth: 35 }}>
                    <MDTypography variant="body2" color="text">
                      {`${institution.complianceScore}%`}
                    </MDTypography>
                  </Box>
                </Box>
              </MDBox>
            </Grid>
            <Grid item xs={4}>
              <MDBox>
                <MDTypography variant="caption">Last Inspection</MDTypography>
                <MDTypography variant="body2">
                  {institution.lastInspectionDate}
                </MDTypography>
              </MDBox>
            </Grid>
          </Grid>

          {institution.violations.length > 0 && (
            <MDBox mt={2}>
              <MDTypography variant="caption" color="error">Violations:</MDTypography>
              {institution.violations.map((violation, index) => (
                <MDTypography key={index} variant="body2" color="error">
                  • {violation}
                </MDTypography>
              ))}
            </MDBox>
          )}

          {institution.requiredActions.length > 0 && (
            <MDBox mt={2}>
              <MDTypography variant="caption" color="warning">Required Actions:</MDTypography>
              {institution.requiredActions.map((action, index) => (
                <MDTypography key={index} variant="body2" color="warning">
                  • {action}
                </MDTypography>
              ))}
            </MDBox>
          )}
        </MDBox>
      </Card>
    </Grid>
  );

  return (
    <DashboardLayout>
      <DashboardNavbar />
      <MDBox my={3}>
        <MDBox>
          <MDTypography variant="h4" mb={2}>AI Compliance Analytics</MDTypography>

          {nonCompliantInstitutions.length > 0 && (
            <MDAlert color="error" dismissible>
              {nonCompliantInstitutions.length} Institutions Require Immediate Attention
            </MDAlert>
          )}

          <Grid container spacing={2} mb={3}>
            <Grid item xs={4}>
              <Card>
                <MDBox p={2} textAlign="center">
                  <MDTypography variant="h3" color="success">
                    {complianceMetrics.overallComplianceRate.toFixed(1)}%
                  </MDTypography>
                  <MDTypography variant="caption">Overall Compliance Rate</MDTypography>
                </MDBox>
              </Card>
            </Grid>
            <Grid item xs={4}>
              <Card>
                <MDBox p={2} textAlign="center">
                  <MDTypography variant="h3" color="error">
                    {complianceMetrics.highRiskInstitutions}
                  </MDTypography>
                  <MDTypography variant="caption">High-Risk Institutions</MDTypography>
                </MDBox>
              </Card>
            </Grid>
            <Grid item xs={4}>
              <Card>
                <MDBox p={2} textAlign="center">
                  <MDTypography variant="h3">
                    {complianceMetrics.totalInstitutions}
                  </MDTypography>
                  <MDTypography variant="caption">Total Monitored Institutions</MDTypography>
                </MDBox>
              </Card>
            </Grid>
          </Grid>

          <MDTypography variant="h6" mb={2}>Non-Compliant and High-Risk Institutions</MDTypography>
          <Grid container spacing={2}>
            {nonCompliantInstitutions.map(renderComplianceCard)}
          </Grid>

          <MDBox mt={4}>
            <MDButton color="primary" fullWidth>
              Generate Comprehensive Compliance Report
            </MDButton>
          </MDBox>
        </MDBox>
      </MDBox>
      <Footer />
    </DashboardLayout>
  );
}

export default ComplianceAnalytics;
